/*
@cyan:         #35a766;
@blue:         #5977d3;
@purple:       #8100c6;
@green:        #8fad06;
@red:          #d24d4d;
@orange:       #cd8e21;
@light-orange: #e3a92d;
*/
.github-FilePatchView {
  display: flex;
  flex-direction: column;
  -webkit-user-select: none;
  cursor: default;
  flex: 1;
  min-width: 0;
}
.github-FilePatchView-header {
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 5px;
  padding-left: 10px;
  border-bottom: 1px solid #e0dacc;
}
.github-FilePatchView-header .btn {
  font-size: .9em;
}
.github-FilePatchView-header .btn.icon-move-up::before,
.github-FilePatchView-header .btn.icon-move-down::before {
  font-size: 1em;
  margin-right: .5em;
}
.github-FilePatchView-title {
  flex: 1;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
  margin-right: 10px;
}
.github-FilePatchView-container {
  flex: 1;
  overflow-y: auto;
}
